import React, { Component } from "react";

export default class Talent extends Component {
  state = {
    selected: false
  };

  isSelected = () => {
    const selected = "";
    if (Math.random() < 0.5) {
      selected = true;
    } else {
      selected = false;
    }
    this.setState({
      selected: selected
    });
  };

  render() {
    return (
      <td>
        <img
          src={this.props.talent.icon_url["64x64"]}
          selected={this.props.selected}
        />
      </td>
    );
  }
}
